"/zx-portfolio/assets/ashi-2-DgSPKZYN.jpg",kz="/zx-portfolio/assets/ashi-3-33ijlc3k.jpg",Uz="/zx-portfolio/assets/ashi-4-DcRTx-Dz.jpg",Pz="/zx-portfolio/assets/sen-to-kaze-Dwgsfxgx.jpg",_z="/zx-portfolio/assets/nara-1-DZC_uRL5.jpg",Vz="/zx-portfolio/assets/nara-2-ByE66Wse.jpg",Hz="/zx-portfolio/assets/fushimi-1-BsQl0gg_.jpg",Fz="/zx-portfolio/assets/fushimi-2-BhDTJ3o_.jpg",Qz="/zx-portfolio/assets/fushimi-3-BKVxmBDP.jpg",Gz="/zx-portfolio/assets/fushimi-4-CMHrLPjI.jpg",Iz="/zx-portfolio/assets/curry-Bn0qOFy8.jpg",Yz="/zx-portfolio/assets/hiei-1-BGsbBKyr.jpg",qz="/zx-portfolio/assets/hiei-2-8q8hcy2Y.jpg",Kz="/zx-portfolio/assets/hiei-3-oAL14n8Y.jpg",Xz="/zx-portfolio/assets/hiei-4-BbZGWWmZ.jpg",Zz="/zx-portfolio/assets/ichiran-Cj4XF4Fw.jpg",Wz="/zx-portfolio/assets/arashiyama-1-Bq_VSLjX.jpg",Jz="/zx-portfolio/assets/arashiyama-2-CjbYQVSk.jpg",$z="/zx-portfolio/assets/yasaka-1-DIlafF23.jpg",ek="/zx-portfolio/assets/yasaka-2-DKLKdYej.jpg",tk="/zx-portfolio/assets/namba-yasaka-1-Cjb3oP4x.jpg",nk="/zx-portfolio/assets/namba-yasaka-2-BKTIu_ta.jpg",ak="/zx-portfolio/assets/dotonbori-1-WRQn14sp.jpg",rk="/zx-portfolio/assets/dotonbori-2-dp7evqkR.jpg",fa=({children:e,title:n})=>b.jsxs("div",{className:"w-full text-left mb-5 blog-section first:border-t-0 border-t-4 border-gray-400 py-4",children:[b.jsx("div",{className:"text-lg font-semibold mb-3",children:n}),e]});function ik(){return b.jsx(b.Fragment,{children:b.jsxs("div",{className:"container mx-auto",children:[b.jsxs("div",{className:"flex flex-col justify-center",children:[b.jsx("div",{className:"text-3xl bold font-semibold py-4",children:"Back in Japan"}),b.jsx("div",{children:"24th Dec - 2nd Jan"})]}),b.jsxs("div",{className:"flex flex-col md:px-12 py-4 px-4",children:[b.jsx(fa,{title:"Day 1: Back to Japan",children:"After a long few months in Canada, it was time to head back home but first off, a casual stop over in Japan to meet up with some good friends. By the time the plane landed, it was already 8pm. So nothing much happened, just fell asleep."}),b.jsxs(fa,{title:"Day 2: Exploring Shinjuku and Akihabara",children:["First off, Shinjuku. We briefly explored the area around Shinjuku station before heading towards Shinjuku Gyoen National Garden. Despite it being winter, most of the trees still had leaves and were not bare. There was even a greenhouse to house many different types of plants, with a similar vibe to our very own Gardens by the Bay.",b.jsx("br",{}),'After exploring the area, we moved over to Akihabara to enjoy some "culture". We ate at a maid cafe. The food was alright, but it was definitely an experience.',b.jsx("br",{}),"Nothing much happened in the afternoon, we just walked around Akiba looking at the various anime figurines and toys before getting some okonomiyaki at a nearby restaurant. In the evening, we took a nice stroll along the river to digest before calling it a night.",b.jsx(ln,{images:[xz,Az,wz],forBlog:!0})]}),b.jsxs(fa,{title:"Day 3: Mt Takao and Cats",children:["We woke up bright and early today to head out towards Mt Takao. It is said to be one of the easier mountains to hike up so we felt up to the challenge. The entire journey up and down took us about 4 -5 hours and the view was spectacular There was even a shrine near the top where we managed to get some souvenirs for friends and family.",b.jsx("br",{}),"After the hike, we made our way back to the heart of tokyo and dropped by a Cat cafe.",b.jsx(ln,{images:[Sz,Tz,Ez,Mz,Cz],forBlog:!0})]}),b.jsxs(fa,{title:"Day 4: Heading to Hakone",children:["The next day, we headed towards our main destination of the day, Hakone. This journey would be quite longer and require us to change trains and even take a bus all the way into Hakone and Lake Ashi. One thing we did not expect was actually the challenge getting there even with bus as there was quite a jam getting in. However, after about 3 - 4 hours, we made it to our hotel, where we quickly dropped off our stuff before trying to scramble to make use of the remaining daylight to explore Hakone. We took the Hakone ropeway and made our way over to the Owakudani sulfur field. The journey along the ropeway was stunning and we could overlook Lake Ashi briefly and even see Mt Fuji. Owakudani too was stunning, being able to see the sulfur plumes rising and the many terraces that spot the landscape, though the smell was quite overpowering.",b.jsx("br",{}),"We made our way back down and got dinner, which was tofu katsu, something we had never even seen before. We then tried the onsen back at our hotel and called it a day.",b.jsx(ln,{images:[Rz,Dz,jz,Oz,Nz,Bz],forBlog:!0})]}),b.jsxs(fa,{title:"Day 5: From Lake Ashi to Kyoto",children:["We woke up bright and early to take a leisure stroll around Lake Ashi. The morning breeze was really refreshing and there was not many people around, so it was a nice and quite walk around the lake. After which, we headed off back to train station to prepare to take the shinkansen towards Kyoto.",b.jsx("br",{}),"Once there, we didnt have a lot of time left, so we just walked around and prepared to grab dinner at a ramen place called Sen-no-kaze. The queue was really long of about 2 hours, so we walked around and ended up addicted to some gachapon machines and trying to get a specific keychain. Not the best idea but it was once again an experience. We eventually got to eat our dinner and I must say, it was really good, like one of the best meals of this trip so far.",b.jsx(ln,{images:[Lz,zz,kz,Uz,Pz],forBlog:!0})]}),b.jsxs(fa,{title:"Day 6: Nara Park and Fushimi Inari Shrine",children:["Today, we headed off towards Nara park to take a look at the deer and see whats so popular about it. However, what I did not expect was the sheer number of deers that were roaming the entire area. I was expecting to see like maybe fifty or like a hundred in a specific area. They were everywhere. From the garden area all the way to kasugataisha, they are roaming freely around the entire region. Cars would even wait for them to cross the road before moving.",b.jsx("br",{}),"The time has come for us to move on and we headed to Fushimi Inari Shrine after lunch. Not gonna lie, this was quite the struggle to get up actually. It was just stair after stair after stair to get to the top. However, the view from up above was spectacular, giving a full view of the city below.",b.jsx(ln,{images:[_z,Vz,Hz,Fz,Qz,Gz,Iz],forBlog:!0})]}),b.jsxs(fa,{title:"Day 7: Climbing Mount Hiei and getting lost?",children:["We started off the day first off thinking of how to scale Mount Hiei. Our idea at the start was to be able to have a good view of Lake Biwa. So we took the eizan tram halfway up the mountain before attempting to hike the rest of the way up. However, as we walked around, what we eventually realised was that we were actually very far from where we wanted to go, so we decided to just walk and hopefully get somewhere. We did eventually get to a group of shrines, but eventually turned around as we needed to grab lunch soon.",b.jsx("br",{}),"The rest of the day was not as eventful, we grabbed lunch over at ichiran and rested for most of the day as we were quite worn out.",b.jsx(ln,{images:[Yz,qz,Kz,Xz,Zz],forBlog:!0})]}),b.jsxs(fa,{title:"Day 8: Arashiyama and Countdown",children:["It was new year's eve and we wanted to partake in Hatsumode, basically a countdown to the new year. So we decided to do our actvities in the morning and then rest in the afternoon and evening, before heading out to queue to enter the shrine. So first off, we headed to Arashiyama Bamboo forest. It was very, very crowded and it was honestly very hard to move around with such a crowd.",b.jsx("br",{}),"After that, we headed back to our hotel to rest up and prepare to head to the shrine that was open and near to us, Yasaka shrine. Even at 11pm, the queue was out of this world and there were thousands waiting to enter. The vibes were amazing, hearing everyone countdwn, followed by a fireworks display. However, we still needed to wait for another 2 hours before we could enter the shrine. By the time we were done, it was almost 3am.",b.jsx(ln,{images:[Wz,Jz,$z,ek],forBlog:!0})]}),b.jsxs(fa,{title:"Day 9: Heading to Osaka",children:["After a long day last night, we decided to only move off during hotel checkout time and headed towards Osaka. When we got there, we visited another shrine, Yasaka shrine to once again get some blessings, before heading to dotonbori to take in the sights and explore the area. However, we once again decided to retire early as not only were we still slightly sleep deprived, but had a very early morning the next day to head to Kansai airport",b.jsx(ln,{images:[tk,nk,ak,rk],forBlog:!0})]}),b.jsx(fa,{title:"Day 10: Back to Singapore",children:"Nothing much happened, we just headed back to Singapore, but did a short transfer at Shanghai where funny enough, we ate Sukiya for lunch"})]})]})})}function ok(){return b.jsx("div",{children:"You seem to have encountered an error"})}const sk=_C([{path:"/",element:b.jsx(YR,{}),errorElement:b.jsx(ok,{}),children:[{index:!0,element:b.jsx(DO,{})},{path:"about",element:b.jsx(ON,{})},{path:"projects",element:b.jsx($B,{})},{path:"travels",children:[{index:!0,element:b.jsx(bz,{})},{path:"dec-2024",element:b.jsx(ik,{})}]}]}]);function lk(){return b.jsx(b.Fragment,{children:b.jsx(fC,{router:sk})})}FT.createRoot(document.getElementById("root")).render(b.jsx(x.StrictMode,{children:b.jsx(lk,{})}));
